import React, { Component } from "react";

import "./App.css";

import AnimalCard from "./Animal-Card";
import { animals } from "./animals-array";
import { render } from "react-dom";

class App extends Component {
  state = {
    animals: animals,
  };

  render() {
    return (
      <div>
        <h1> Animal Apps </h1>
      </div>
    );
  }
}

export default App;
